import React from 'react';

const UserDashboard = ({ user, favorites, spaces }) => {
  // Filtrar los espacios favoritos
  const favoriteSpaces = spaces.filter((space) => favorites.includes(space.id));

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-4xl font-bold mb-6 text-center text-gray-700">
        Panel de Usuario
      </h1>
      <h2 className="text-2xl font-bold mb-4">Bienvenido, {user?.name || 'Usuario'}!</h2>

      {/* Espacios Favoritos */}
      <section className="mb-8">
        <h3 className="text-xl font-bold mb-4">Mis Favoritos</h3>
        {favoriteSpaces.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
            {favoriteSpaces.map((space) => (
              <div
                key={space.id}
                className="border rounded-lg p-4 shadow hover:shadow-lg"
              >
                <h4 className="font-bold text-lg">{space.name}</h4>
                <p>{space.location}</p>
                <p className="text-blue-500 font-bold">${space.price}/mes</p>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-gray-500">No tienes espacios favoritos.</p>
        )}
      </section>

      {/* Reservas */}
      <section>
        <h3 className="text-xl font-bold mb-4">Mis Reservas</h3>
        {/* Aquí podrías incluir un listado de reservas */}
        <p className="text-gray-500">Funcionalidad de reservas pendiente.</p>
      </section>
    </div>
  );
};

export default UserDashboard;
